import React from 'react'


const Cell = ({details}) => {
  return( 
  <div onClick={() => console.log(details)} style={style.cellStyle}>
    {details.value}
  </div>
    
  )
};
const style = {
  cellStyle:{
    width:40, height:40, background: "lightgrey",
    display:'flex',
    justifyContent:'center',
    alignItems:'center'

  }
}
export default Cell
